import React from 'react';
import ServiceHome from '../infocomponents/ServiceHome';
import PickUpHome from '../infocomponents/PickUpHome';

function Description() {
	return (
		<div>
			<section id="Description">
				<ServiceHome />
				<br />
				<PickUpHome />
			</section>
		</div>
	);
}

export default Description;
